int longestConsecutiveHelper(TreeNode* curr, int streakLength, int lastNum)
{
	if (curr == NULL)
		return streakLength;

	if (curr->val == lastNum + 1)
	{
		record.push_back(curr->val);
		return max(longestConsecutiveHelper(curr->left, streakLength+1, curr->val), longestConsecutiveHelper(curr->right, streakLength+1, curr->val));
	}
	else
	{
		int recStreak = max(longestConsecutiveHelper(curr->left, 1, curr->val), longestConsecutiveHelper(curr->right, 1, curr->val) );
		return max(streakLength, recStreak);
	}

}


int longestConsecutive(TreeNode* root) {
	if (root == NULL)
		return 0;

	if (root->left == NULL && root->right == NULL)
		return 1;

	return max(longestConsecutiveHelper(root->left, 1, root->val), longestConsecutiveHelper(root->right, 1, root->val) );

}